		  <h1 className="f4 bg-near-black white mv0 pv2 ph3">{name}</h1>
		  <div className="pa3 bt">
		    <p className="f6 f5-ns lh-copy measure mv0">{homeworld}</p>
			<p className="f6 f5-ns lh-copy measure mv0">{birth_year}</p>
			<p className="f6 f5-ns lh-copy measure mv0">{height}</p>
			<p className="f6 f5-ns lh-copy measure mv0">{mass}</p>
		  </div>
		</article>
	    </div>
    )
}

export default Card;


